import React from "react";

function LoginDetails() {
  return (
    <div
      style={{
        height: "100%",
        width: "100%",
        display: "flex",
        marginTop: "10vh",
      }}
    >
      <div
        style={{
          height: "100%",
          width: "40%",
          textAlign: "right",
          paddingRight: "5vw",
          paddingLeft: "1vw",
          fontWeight: "600",
          color: "#474444",
          fontSize: "1.3em",
          paddingBottom: "3vw",
        }}
      >
        <p style={{ height: "22%" }}>Email</p>
        <p style={{ height: "22%" }}>Password</p>
      </div>
      <div style={{ height: "100%", width: "60%" }}>
        <form method="post" style={{ marginTop: "-3.2vh", paddingBottom: "3vw" }}>
          <p>
            <input className="signup-login-input"></input>
          </p>
          <p>
            <input className="signup-login-input"></input>
          </p>
        </form>
      </div>
    </div>
  );
}

export default LoginDetails;
